import YouTube from './assets/youtubePurple.webp'
import Podcast from './assets/podcastPurple.webp'
import Resources from './assets/resourcesPurple.webp'
import Blog from './assets/blogPurple.webp'

const SocialList2 = [
    {
        icon: YouTube,
        social: "Youtube",
        sub: "A library of tutorials, guides, and ecosystem interviews."
    },

    {
        icon: Podcast,
        social: "Podcast",
        sub: "Interviews and talks in audio form."
    },

    {
        icon: Resources,
        social: "Resources",
        sub: "A collection of videos, podcasts, and blog posts."
    },

    {
        icon: Blog,
        social: "Blog",
        sub: "News and updates from Celestia Labs."
    }
]

export default SocialList2
